import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';

const App = () => {
  const scrollTo = (sectionId) => {
    document.getElementById(sectionId).scrollIntoView({behavior: 'smooth'});
  };

  return (
    <div className="App">
      <div id="navbar">
        <h2>Roshan Gokul</h2>
        <button id="navButton" onClick={() => scrollTo('experience')}>Experience</button>
        <button id="navButton" onClick={() => scrollTo('projects')}>Projects</button>
        <button id="navButton" onClick={() => scrollTo('projects')}>GitHub</button>
        <a id="navButton" href="https://github.com/roshangokul">Contact Me</a>

      </div>

      <div id="aboutMe" className="section">



      </div>
      <div id="experience" className="section">
        <br></br>
        <div className="job">
          <h2>Software Engineer Intern</h2>
          <h3>Chewy</h3>
          <p>Currently on Fullfillment Operations</p>
        </div>
        <div className="job">
          <h2>Software Engineer Intern</h2>
          <h3>ImageTrend</h3>
          <p>Elite Team- Utilized C#/.NET to create an in-house Azure application to automatically assign code reviews</p>
        </div>
      </div>
      <div id="projects" className="section">Projects</div>
    </div>
  );
}

export default App;
